                var html_49195dc775e3bbdc03367b5abcb5ea5e = $(`<div id="html_49195dc775e3bbdc03367b5abcb5ea5e" style="width: 100.0%; height: 100.0%;"> <div style="display:flex;align-items: center;"> <p style='font-size:16px;'>Somnath Jyotirlinga, situated in Gujarat, India, is a sacred Hindu temple devoted to Lord Shiva. Revered as one of the twelve Jyotirlingas, it symbolizes divine power and spiritual enlightenment. Despite historical invasions and reconstructions, the temple stands as a testament to resilience and faith, attracting devotees worldwide for worship and spiritualrejuvenation.</p> <a href='Somnath.html' target='_blank'><img src='somnath.jpeg' alt='Image' style='width:256px;height:300px;margin-right:10px;'> <figcaption>Somnath</figcaption></a> </div></div>`)[0];

                var html_2c6bfa5dd92e8368df666c507b7fe063 = $(`<div id="html_2c6bfa5dd92e8368df666c507b7fe063" style="width: 100.0%; height: 100.0%;"> <div style="display:flex;align-items: center;"> <p style='font-size:16px;'>Srisailam Temple, nestled in the Nallamala Hills along the Krishna River, is a revered Hindu pilgrimage site in Andhra Pradesh, India. Dedicated to Lord Shiva as Mallikarjuna, its one of the twelve Jyotirlingas. The temples architectural grandeur and serene surroundings attract devotees seeking spiritual solace and divine blessings, enriching culturalheritage.</p> <a href='Srisailam.html' target='_blank'><img src='srisai.webp' alt='Image' style='width:256px;height:300px;margin-right:10px;'> <figcaption>Srisailam</figcaption></a> </div></div>`)[0];

                var html_a0750eef3037057937c174ddb06b539b = $(`<div id="html_a0750eef3037057937c174ddb06b539b" style="width: 100.0%; height: 100.0%;"> <div style="display:flex;align-items: center;"> <p style='font-size:16px;'>Ujjain Mahakal Jyotirlinga, in Madhya Pradesh, is revered as one of the twelve Jyotirlingas, representing Lord Shivas divine presence. Situated along the banks of the Shipra River, the temple exudes spiritual energy and historical significance. Its architecture reflects intricate craftsmanship, drawing devotees from far and wide for prayersandrituals.</p> <a href='Ujjain_Mahakal.html' target='_blank'><img src='ujjain.jpg' alt='Image' style='width:256px;height:300px;margin-right:10px;'> <figcaption>Ujjain Mahakal</figcaption></a> </div></div>`)[0];

                var html_3706f65f6399c77cb31c7fc34a55dfc3 = $(`<div id="html_3706f65f6399c77cb31c7fc34a55dfc3" style="width: 100.0%; height: 100.0%;"> <div style="display:flex;align-items: center;"> <p style='font-size:16px;'>Omkareshwar Jyotirlinga is a revered Hindu pilgrimage site situated in Madhya Pradesh, India. Dedicated to Lord Shiva, it holds significance as one of the twelve Jyotirlingas. Nestled on the banks of the Narmada River, its temple architecture blends intricate designs with spiritual ambiance, drawing devotees and tourists seeking divineblessings.</p> <a href='Omkareshwar.html' target='_blank'><img src='Omkareshwar.webp' alt='Image' style='width:256px;height:300px;margin-right:10px;'> <figcaption>Omkareshwar</figcaption></a> </div></div>`)[0];

                var html_b5d185d3d276c8a817877c5722b85c1b = $(`<div id="html_b5d185d3d276c8a817877c5722b85c1b" style="width: 100.0%; height: 100.0%;"> <div style="display:flex;align-items: center;"> <p style='font-size:16px;'>The Baidyanath Temple, also known as Baba Baidyanath Dham or Baidyanath Jyotirlinga Temple, is a highly revered Hindu temple dedicated to Lord Shiva. It is located in Deoghar in the state of Jharkhand, India. The temple houses one of the twelve Jyotirlingas, which are considered to be the holiest shrines of Lord Shiva.The Baidyanath Temple attracts a large number of devotees throughout the year, especially during the holy month of Shravan according to the Hindu calendar.</p> <a href='Badiyanath.html' target='_blank'><img src='Baidhyanth.jpeg' alt='Image' style='width:256px;height:300px;margin-right:10px;'> <figcaption>Baidyanath</figcaption></a> </div></div>`)[0];

                var html_43b6a28744522079123fe76cbf1d52f8 = $(`<div id="html_43b6a28744522079123fe76cbf1d52f8" style="width: 100.0%; height: 100.0%;"> <div style="display:flex;align-items: center;"> <p style='font-size:16px;'>Bhimashankar Jyotirlinga, nestled in the Sahyadri range of Maharashtra, is a revered Hindu pilgrimage site dedicated to Lord Shiva. Believed to be one of the twelve Jyotirlingas, it attracts devotees with its spiritual aura and scenic beauty. The temples architecture and natural surroundings offer a serene atmosphere for prayer andintrospection.</p> <a href='Bhimashankar.html' target='_blank'><img src='bhimashankar2.jpg' alt='Image' style='width:256px;height:300px;margin-right:10px;'> <figcaption>Bhimashakar</figcaption></a> </div></div>`)[0];

                var html_fa9c70aea9905cd6a3f7f91a482e6cfc = $(`<div id="html_fa9c70aea9905cd6a3f7f91a482e6cfc" style="width: 100.0%; height: 100.0%;"> <div style="display:flex;align-items: center;"> <p style='font-size:16px'>Rameshwaram Jyotirlinga, nestled on Rameshwaram Island in Tamil Nadu, India, is a revered Hindu pilgrimage site dedicated to Lord Shiva. Believed to be one of the twelve Jyotirlingas, it holds immense religious importance. The temples architectural splendor and spiritual aura draw devotees seeking purification, blessings, and divine grace, enriching spiritualjourneys.</p> <a href='RamnathSwamy.html' target='_blank'><img src='rameshwaram.jpg' alt='Image' style='width:256px;height:300px;margin-right:10px;'> <figcaption>Rameshwaram</figcaption></a> </div></div>`)[0];

                var html_d474abca6719a66c11c4f7fe695c3bfe = $(`<div id="html_d474abca6719a66c11c4f7fe695c3bfe" style="width: 100.0%; height: 100.0%;"> <div style="display:flex;align-items: center;"> <p style='font-size:16px;'>Kashi Vishwanath refers to the famous Vishwanath Temple located in the holy city of Varanasi, India. It is one of the most revered Hindu temples dedicated to Lord Shiva. The temple holds great religious significance and attracts devotees and tourists from all over the world. Its historical and cultural importance dates back centuries, making it a symbol of faith and spirituality for millionsofpeople.</p> <a href='Kashi.html' target='_blank'><img src='aartii.webp' alt='Image' style='width:256px;height:300px;margin-right:10px;'> <figcaption>Kashi Vishwanath</figcaption></a> </div></div>`)[0];

                var html_472a2b047ed697c60ab932b718437fc6 = $(`<div id="html_472a2b047ed697c60ab932b718437fc6" style="width: 100.0%; height: 100.0%;"> <div style="display:flex;align-items: center;"> <p style='font-size:16px;'>Triambakeshwar Jyotirlinga, situated in Maharashtra, holds significance as one of the twelve Jyotirlingas devoted to Lord Shiva. Positioned at the source of the Godavari River, it symbolizes divine power and spiritual purity. The temples architecture boasts intricate designs, attracting devotees and tourists seeking blessings and spiritualenlightenment.</p> <a href='Trimbakeshwar.html' target='_blank'><img src='trimba.avif' alt='Image' style='width:256px;height:300px;margin-right:10px;'> <figcaption>Triambakeshwar</figcaption></a> </div></div>`)[0];

                var html_720195bc988d9feb0aa3e92c0ddecfed = $(`<div id="html_720195bc988d9feb0aa3e92c0ddecfed" style="width: 100.0%; height: 100.0%;"> <div style="display:flex;align-items: center;"> <p style='font-size:16px;'>Grishneshwar Jyotirlinga, located near Ellora in Maharashtra, is a sacred Hindu pilgrimage site devoted to Lord Shiva. Its one of the twelve Jyotirlingas, embodying immense spiritual importance. The temples architecture showcases intricate carvings and reflects ancient Hindu craftsmanship. Devotees flock here seeking blessings and divine interventionintheirlives.</p> <a href='Ghrishnshwar.html' target='_blank'><img src='grishneshwar.jpg' alt='Image' style='width:256px;height:300px;margin-right:10px;'> <figcaption>Ghrishneshwar</figcaption></a> </div></div>`)[0];
